import React, {useState} from 'react'

const Auth = React.createContext(false)

export default function AuthContext(props) {
    const [auth, setauth] = useState(false)

    return (
        <Auth.Provider value={auth}>
            {props.childern}
        </Auth.Provider>
    )
}
